Fantastic racing today at CLASH Daytona. Hope you had a chance to watch some of the action. How cool is it to race around the track at Daytona? Yesterday, before the race, I had the pleasure of getting to chat with 12 awesome triathletes for Day 2 of Breakfast with Bob. You can catch all the pre-race interviews on the Babbittville YouTube channel --> link in bio. Congrats to some of the top finishers here: @saraperezsala (2nd), @juliederron (3rd), Jackie Hering (4th), Matt Hanson (5th), Matt Sharpe (6th), and Grace Alexander (9th) 

📷 @gefromproductions 

