It's Challenge Roth Week! Very excited to be going back to the amazing Challenge Roth once again. Join us this week for Breakfast with Bob interviews: Challenge Roth Edition. We have some very special interviews coming up today through Wednesday and then we will be bringing you pre-race interviews from Roth on Thursday and Friday, leading into the race on Sunday.

Thank you to the wonderful team at @challengeroth and our awesome sponsors and partners: 

@masterspas, @sfuels.sf @hoka, @formswim, @zootsports, @premiumplussports, and the @cafoundation

